// src/modules/community-resilience/edu-barter/edu-barter.service.ts
var EduBarterService = class {
  static {
    __name(this, "EduBarterService");
  }
  pg;
  metrics;
  constructor(pg2) {
    this.pg = pg2;
    this.metrics = MetricsCollector.getInstance();
  }
  // ==================== SCHOOL MANAGEMENT ====================
  async registerSchool(school) {
    const validated = RuralSchoolSchema.parse(school);
    const client = await this.pg.connect();
    try {
      const res = await client.query(`
        INSERT INTO rural_schools (
          name, region, contact_phone, needs, accepts, students_count, is_offline_mode, created_at
        ) VALUES ($1, $2, $3, $4, $5, $6, $7, NOW())
        RETURNING id
      `, [
        validated.name,
        validated.region,
        validated.contactPhone,
        validated.needs,
        validated.accepts,
        validated.studentsCount,
        validated.isOfflineMode
      ]);
      this.metrics.increment("edu_barter.school_registered", { region: validated.region });
      return res.rows[0].id;
    } finally {
      client.release();
    }
  }
  // ==================== PAYMENT & ESCROW ====================
  async createEscrowAgreement(agreement) {
    const client = await this.pg.connect();
    try {
      const res = await client.query(`
        INSERT INTO barter_escrows (
          school_id, parent_id, facilitator_id, amount, barter_item, status, created_at
        ) VALUES ($1, $2, $3, $4, $5, 'active', NOW())
        RETURNING id
      `, [
        agreement.schoolId,
        agreement.parentId,
        agreement.facilitatorId,
        agreement.paymentDetails.amount || 0,
        agreement.paymentDetails.barterItem
      ]);
      return res.rows[0].id;
    } finally {
      client.release();
    }
  }
  // ==================== SMS HANDLER ====================
  async handleSMS(phone, message) {
    const parts = message.split(" ");
    const action = parts[1]?.toUpperCase();
    if (action === "INSCRIBIR") {
      const student = parts[2];
      const schoolName = parts[3];
      return `RECIBIDO: Solicitud inscripci\xF3n ${student} en ${schoolName}. Enviar pago o trueque para confirmar.`;
    }
    if (action === "PAGAR") {
      const item = parts[2];
      const schoolName = parts[3];
      return `RECIBIDO: Oferta pago ${item} para ${schoolName}. Esperando confirmaci\xF3n director.`;
    }
    return "COMANDO NO RECONOCIDO. Use: ESCUELA INSCRIBIR [Nombre] [Escuela]";
  }
};

