var VisibilityTypeSchema = external_exports.enum(["offer-top3", "request-alert"]);
var VisibilityTierSchema = external_exports.object({
  id: external_exports.string(),
  signalId: external_exports.string(),
  type: VisibilityTypeSchema,
  durationDays: external_exports.number().optional(),
  // 1, 3, 7 (solo para ofertas)
  region: external_exports.string(),
  // "MX", "US-CA", "BD"
  amountUSD: external_exports.number(),
  // $1.00 a $7.50
  status: external_exports.enum(["active", "expired", "pending-payment"]),
  activatedAt: external_exports.number(),
  expiresAt: external_exports.number()
});
var VisibilityService = class {
  static {
    __name(this, "VisibilityService");
  }
  redis;
  pgPool;
  priceTable = {
    // Precios en USD (United States Dollars)
    "MX": { alert: 2.5, "1-day": 1.5, "3-day": 4, "7-day": 9 },
    "US": { alert: 5, "1-day": 2.5, "3-day": 6, "7-day": 12 },
    "BD": { alert: 1.5, "1-day": 1, "3-day": 2.5, "7-day": 5 },
    "GLOBAL": { alert: 3, "1-day": 2, "3-day": 5, "7-day": 10 }
  };
  constructor(redis, pgPool) {
    this.redis = redis;
    this.pgPool = pgPool;
  }
  async calculatePrice(region, type, durationDays) {
    const regionPrices = this.priceTable[region] || this.priceTable["MX"];
    if (type === "request-alert") {
      return regionPrices.alert;
    }
    return regionPrices[`${durationDays}-day`] || 1;
  }
  async activateVisibility(signalId, type, region, durationDays) {
    const amount = await this.calculatePrice(region, type, durationDays);
    const now = Date.now();
    const expiresAt = durationDays ? now + durationDays * 24 * 60 * 60 * 1e3 : now + 30 * 24 * 60 * 60 * 1e3;
    const tier = {
      id: Math.random().toString(36).substring(7),
      signalId,
      type,
      durationDays,
      region,
      amountUSD: amount,
      status: "active",
      activatedAt: now,
      expiresAt
    };
    await this.pgPool.query(
      "INSERT INTO visibility_tiers (id, signal_id, type, duration_days, region, amount_usd, status, activated_at, expires_at) VALUES ($1, $2, $3, $4, $5, $6, $7, $8, $9)",
      [tier.id, tier.signalId, tier.type, tier.durationDays, tier.region, tier.amountUSD, tier.status, new Date(tier.activatedAt), new Date(tier.expiresAt)]
    );
    await this.redis.set(`visibility:${signalId}`, JSON.stringify(tier), "PX", expiresAt - now);
    logger3.info(`[Visibility] Activated ${type} for signal ${signalId} in ${region}`);
    return tier;
  }
  async getActiveVisibility(signalId) {
    const cached2 = await this.redis.get(`visibility:${signalId}`);
    if (cached2) return JSON.parse(cached2);
    const result = await this.pgPool.query(
      "SELECT * FROM visibility_tiers WHERE signal_id = $1 AND status = 'active' AND expires_at > NOW() LIMIT 1",
      [signalId]
    );
    if (result.rows.length > 0) {
      const row = result.rows[0];
      const tier = {
        id: row.id,
        signalId: row.signal_id,
        type: row.type,
        durationDays: row.duration_days,
        region: row.region,
        amountUSD: parseFloat(row.amount_usd),
        status: row.status,
        activatedAt: row.activated_at.getTime(),
        expiresAt: row.expires_at.getTime()
      };
      return tier;
    }
    return null;
  }
};

